// Database models
const MinutiaePointSchema = new Schema({
    x: { type: Number, required: true },
    y: { type: Number, required: true },
    type: { type: String, required: true },
    angle: { type: Number, required: true }
}, { _id: false });

const RidgeFlowSchema = new Schema({
    x_start: { type: Number, required: true },
    y_start: { type: Number, required: true },
    x_end: { type: Number, required: true },
    y_end: { type: Number, required: true }
}, { _id: false });

const FingerprintSchema = new Schema({
    minutiae_points: { type: [MinutiaePointSchema], required: true },
    ridge_flow: { type: [RidgeFlowSchema], required: true },
    fingerprint_pattern: { type: String,required: true },
    template_version: { type: String, required: true },
    timestamp: { type: Date, required: true }
}, { _id: false });

const AadharDataSchema = new Schema({
    name: { type: String, required: true, trim: true },
    number: { type: String, unique: true, trim: true },
    age: { type: Number, required: true, min: 0, max: 150 },
    gender: { type: String, required: true, },
    dob: { type: Date, required: true },
    address: { type: String, required: true, trim: true },
    email: { type: String, trim: true, lowercase: true },
    photo: { type: String },
    fingerprint: { type: FingerprintSchema, required: true }
});

const MissingPersonSchema = new Schema({
    name: {
        type: String,
        required: true,
        trim: true
    },
    photo: {
        type: String,
        required: true
    },
    age: {
        type: Number,
        required: true,
        min: 0,
        max: 150
    },
    gender: {
        type: String,
        required: true,
        enum: ['Male', 'Female', 'Other']
    },
    appearance: {
        height: {
            type: String,
            trim: true
        },
        clothes: {
            type: String,
            trim: true
        }
    },
    phone: {
        type: String,
        trim: true
    },
    address: {
        type: String,
        trim: true
    },
    aadharData: AadharDataSchema,
    missingDate: {
        type: Date,
        required: true
    },
    missingTime: {
        type: String,
        required: true,
    }
}, {
    timestamps: true
});

// Add indexes for frequently queried fields
MissingPersonSchema.index({ name: 1 });

// Create and export the model
const MissingPerson = mongoose.model('MissingPerson', MissingPersonSchema);

